script: |
  super -f text -I q10589.spq | sort > q10589.out

inputs:
  - name: q10589.spq
    data: |
      SELECT DISTINCT - col0 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT ( col0 + 14 ) NOT BETWEEN + col2 * col1 AND NULL AND NOT 4 NOT BETWEEN ( + + col0 ) AND NULL;
  - name: tab1

outputs:
  - name: q10589.out
    data: |
